DROP TABLE IF EXISTS `fa_factor_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fa_factor_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `factor_id` int(10) NOT NULL DEFAULT '0' COMMENT '指标ID',
  `max` varchar(32) NOT NULL DEFAULT '' COMMENT '最大值',
  `min` varchar(32) NOT NULL DEFAULT '' COMMENT '最小值',
  `national_stand` varchar(32) NOT NULL DEFAULT '' COMMENT '国家标准',
  `input_mode` varchar(1) NOT NULL DEFAULT 'A' COMMENT '网页输入模式 A:根据公式 C:问卷模式 D：直接输入结果',
  `option` text NOT NULL COMMENT '原始数据输入项',
  `coefficient` text COMMENT '系数',
  `method` varchar(100) NOT NULL DEFAULT '' COMMENT '执行函数',
  `meaning` text NOT NULL COMMENT '含义',
  `calc_method` text NOT NULL COMMENT '计算方式',
  `questions_id` varchar(255) DEFAULT NULL,
  `source` varchar(255) NOT NULL DEFAULT '' COMMENT '数据来源 ',
  `document` text COMMENT '参考文献',
  `question_name` varchar(255) NOT NULL DEFAULT '' COMMENT '问卷名称',
  `question_link` varchar(255) NOT NULL DEFAULT '' COMMENT '问卷下载地址',
  `sample_size` int(11) DEFAULT '0' COMMENT '样本容量',
  `format_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '格式化类型 1：整型  2：百分比',
  `link` varchar(255) NOT NULL DEFAULT '' COMMENT '数据来源link',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1：正常 0：删除',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `create_by` int(10) NOT NULL DEFAULT '0',
  `update_by` int(10) NOT NULL DEFAULT '0',
  `tip` varchar(255) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `factor_id` (`factor_id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

