DROP TABLE IF EXISTS `fa_items`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fa_items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `item_type` int(2) NOT NULL DEFAULT '1' COMMENT '项目类型 1 城市 2 乡村',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '名称',
  `province` int(6) NOT NULL DEFAULT '0' COMMENT '省CODE',
  `city` int(6) NOT NULL DEFAULT '0' COMMENT '市code',
  `area` int(6) NOT NULL DEFAULT '0' COMMENT '区code',
  `location` varchar(255) NOT NULL DEFAULT '' COMMENT '位置',
  `areas` varchar(255) NOT NULL DEFAULT '' COMMENT '面积',
  `item_cate_id` int(2) NOT NULL DEFAULT '0' COMMENT '类型',
  `images` varchar(255) NOT NULL DEFAULT '' COMMENT '图片',
  `introduction` varchar(255) NOT NULL DEFAULT '' COMMENT '项目描述',
  `build_time` varchar(255) NOT NULL DEFAULT '' COMMENT '落成时间',
  `specific` varchar(255) NOT NULL DEFAULT '' COMMENT '具体介绍',
  `programme_design` varchar(255) NOT NULL DEFAULT '' COMMENT '方案设计',
  `designer_team` varchar(255) NOT NULL DEFAULT '' COMMENT '设计团队',
  `construction` varchar(255) NOT NULL DEFAULT '' COMMENT '施工',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 0：删除 1：正常 2：已选取指标 3：已生成报告 4：申请案例 5：申请成功',
  `study_team` varchar(255) NOT NULL DEFAULT '' COMMENT '研究团队',
  `keyword` varchar(255) NOT NULL DEFAULT '' COMMENT '关键词',
  `content` longtext COMMENT '富文本内容',
  `create_time` int(11) DEFAULT '0',
  `update_time` int(11) DEFAULT '0',
  `population` varchar(32) DEFAULT '0',
  `resource` varchar(128) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=113 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

